  }
  if (colors.length < 7) {
    folder2.value = colors[4]
    rainbow7.value = defaultArea.value
    sun_background.value = colors[4]
  }
  if (colors.length < 6) {
    rainbow6.value = defaultArea.value
    rainbow7.value = colors[1]
    cloud2.value = colors[1]
    sun_top.value = colors[1]
  }
  if (colors.length < 5) {
    rainbow7.value = colors[2]
    rainbow6.value = colors[1]
    rainbow5.value = defaultArea.value

    folder1.value = colors[2]
    folder2.value = colors[2]
    folder4.value = colors[2]
    sun_background.value = colors[2]
  }
  if (colors.length < 4) {
